script: |
  super -f text -I q10310.spq | sort > q10310.out

inputs:
  - name: q10310.spq
    data: |
      SELECT + + ( + col2 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + 15 * - col1 * 93 NOT BETWEEN - col2 AND col0;
  - name: tab1

outputs:
  - name: q10310.out
    data: |
      59
      68
      96
